import React from 'react';
import test from '../images/example.jpg'
import Card from 'react-bootstrap/Card'

const MiniCard = () =>{

    return(

<Card border= '#525252' tag="a" onClick={"google.com"} style={{ cursor: "pointer" }} style={{ width: '15rem' }}>
  <Card.Img class= 'card-image' variant="top" src={test} />
  <Card.Body>
    <Card.Title class= 'card-title'>ADIDAS YEEZY BOOST 350 V2 ZEBRA</Card.Title>
    <Card.Text>
      From 250$
    </Card.Text>

  </Card.Body>
</Card>

    );

}
export default MiniCard;
